import React from 'react';
import './Settings.css';

export function Settings({ onBack, onLogout }) {
  return (
    <div className="settings-page">
      <h1>Settings</h1>
      <button onClick={onBack}>Back</button>
      <button onClick={onLogout}>Logout</button>
    </div>
  );
}
